function orderHistoryPage_js() {
    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'navigateButton': 'orderHistoryPage_navigateButton',
        'sortButton': 'orderHistoryPage_sortButton',
        'sortButton-0': 'orderHistoryPage_sortButton-0',
        'oderHistoryList': 'orderHistoryPage_oderHistoryList',
        'orderHistoryItem': 'orderHistoryPage_orderHistoryItem',
        'mobilelistitembutton_7': 'orderHistoryPage_mobilelistitembutton_7'
    };
    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }
    /*
     * Nonvisual components
     */
    Apperyio.mappings = Apperyio.mappings || {};
    Apperyio.datasources = Apperyio.datasources || {};
    Apperyio.CurrentScreen = 'orderHistoryPage';
    _.chain(Apperyio.mappings)
        .filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        })
        .each(Apperyio.UIHandler.hideTemplateComponents);
    /*
     * Events and handlers
     */
    // On Load
    var orderHistoryPage_onLoad = function() {
        orderHistoryPage_elementsExtraJS();
        orderHistoryPage_deviceEvents();
        orderHistoryPage_windowEvents();
        orderHistoryPage_elementsEvents();
    };
    // screen window events
    function orderHistoryPage_windowEvents() {
        $('#orderHistoryPage').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });
    };
    // device events
    function orderHistoryPage_deviceEvents() {
        document.addEventListener("deviceready", function() {
        });
    };
    // screen elements extra js
    function orderHistoryPage_elementsExtraJS() {
        // screen (orderHistoryPage) extra code
        /* sortButton */
        $("#orderHistoryPage_sortButton").parent().find("a.ui-btn").attr("tabindex", "2");
        /* oderHistoryList */
        listView = $("#orderHistoryPage_oderHistoryList");
        theme = listView.attr("data-theme");
        if (typeof theme !== 'undefined') {
            var themeClass = "ui-btn-up-" + theme;
            listItem = $("#orderHistoryPage_oderHistoryList .ui-li-static");
            $.each(listItem, function(index, value) {
                $(this).addClass(themeClass);
            });
        }
        /* orderHistoryItem */
    };
    // screen elements handler
    function orderHistoryPage_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });
        $(document).off("click", '#orderHistoryPage_orderHistoryHeader [name="navigateButton"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('navigatePage', {
                        transition: 'slidedown',
                        reverse: false
                    });
                }
            },
        }, '#orderHistoryPage_orderHistoryHeader [name="navigateButton"]');
    };
    $(document).off("pagebeforeshow", "#orderHistoryPage").on("pagebeforeshow", "#orderHistoryPage", function(event, ui) {
        Apperyio.CurrentScreen = "orderHistoryPage";
        _.chain(Apperyio.mappings)
            .filter(function(m) {
                return m.homeScreen === Apperyio.CurrentScreen;
            })
            .each(Apperyio.UIHandler.hideTemplateComponents);
    });
    orderHistoryPage_onLoad();
};
$(document).off("pagecreate", "#orderHistoryPage").on("pagecreate", "#orderHistoryPage", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    orderHistoryPage_js();
});